import Input from '../../UI/Input';
import style from './MealItemForm.module.css';

export default function MealItemForm(props) {

  const inputProps = {
    id: 'amount_' + props.id,
    type: 'number',
    min: '1',
    max: '10',
    step: '1',
    defaultValue: '1'
  };

  return (
    <>
      <form className={style.form}>
        <Input label="Cantidad" input={inputProps} />
        <button>Agregar</button>
      </form>
    </>
  );
};
